import { createSlice } from '@reduxjs/toolkit'
i
const getData = () => {
  let data = fetch('data.json')
    .then(res => res.json())
    .catch((err)=>console.log(err))
  return data
}
const initialState = getData

export const counterSlice = createSlice({
  name: 'counter',
  initialState
})

export default counterSlice.reducer
